            p_stud -> last_name[i+1] = 0;
            break;
        }
    }
    printf("Gebe nun nacheinander die 5 Punkte ein:\n");
    for (int i = 0; i < 5; i++) {
        printf("%i: ", i+1);
        scanf("%i", &p_stud -> points[i]);
    }
    getchar();
}
