    printf("Student: %s %s\n", p_stud -> first_name, p_stud -> last_name);
    int summe = 0;
    for (int i = 0; i < 5; i++) {
        summe += p_stud -> points[i];
    }
    printf("Anzahl Punkte: %i\n\n", summe);
}
